This is the last version the A.R.E. put out. (They are no longer selling it).
Copyrights finished on 2006.

It contains all of the Edgar Cayce readings plus audio and video. Has various search functions to find what you are looking for or just browse the topics.

Contains 2 CD's. Burn the CD's and insert Disc 1 to start installation. 


